const Task = () => {

    const name = ["Karan", "alpesh", "harsh", "aniket", "jay"]

    function changeValue() {
        document.getElementById('type').value = name[1];
    }


    return (
        <>
            <div>
                <input type="text" id="type" name="type" value="change" />
                <button onClick={ changeValue }>change</button>
            </div>
        </>
    )
}

export default Task
